    def is_valid_grammar(grammar, input_string):
        grammar_map = {}
        for rule in grammar:
            if rule.startswith("S"):
                rule_string = rule[2:]
                grammar_map[rule_string] = rule.split()[0]
            elif rule.startswith("NT"):
                rule_string = rule[2:]
                grammar_map[rule_string] = rule.split()[0]
            elif rule.startswith("T"):
                rule_string = rule[2:]
                grammar_map[rule_string] = rule.split()[0]

        return input_string in grammar_map

